<script>
	import { gsap } from "gsap";
	import { onMount } from "svelte";
	
	let attBBgrande = {
		bb: {duration: 7, y: -70, ease: 'Circ.easeIn', delay: "aleatorio()"},
		bbOpacity: {duration: 0.7, opacity: 0},
		sombraV: {duration: 6.87, y: -80, ease: 'Circ.easeIn'}
	};
	let attBBmediana = {
		bb: {duration: 4, y: -63, ease: 'Circ.easeIn'},
		bbOpacity: {duration: 0.7, opacity: 0},
		sombraV: {duration: 3.97, y: -80, ease: 'Circ.easeIn'} 
	};
	let attBBchiquita2 = {
		bb: {duration: 2.5, y: -75, ease: 'Circ.easeIn'},
