		sombraV: {duration: 5.48, y: -80, ease: 'Circ.easeIn'}
	};
	
	let burbujaGrande = () => {
		let bbG = gsap.timeline({repeat:-1})
		bbG.to("#bbG", attBBgrande.bb)
		bbG.to("#bbG", attBBgrande.bbOpacity, "6.7")
		bbG.to("#sombrabbG", attBBgrande.sombraV, "0")
