		return bbG
	}
	let burbujaMediana = () => {
		let bbG = gsap.timeline({repeat:-1})
		bbG.to("#bbMediana", attBBmediana.bb)
		bbG.to("#bbMediana", attBBmediana.bbOpacity, "3.7")
		bbG.to("#sombraMediana", attBBmediana.sombraV, "0")
